<?php
// Sanitize and validate input
$series_name = isset($_GET['series']) ? htmlspecialchars_decode(trim($_GET['series'])) : 'Unknown Series';
$season_name = isset($_GET['season']) ? htmlspecialchars_decode(trim($_GET['season'])) : 'Unknown Season';


// Load and decode the main JSON file (episodes_data.json)
$json_file = 'episodes_data.json';
if (!file_exists($json_file)) {
    die("Data file not found");
}
$json = file_get_contents($json_file);
$data = json_decode($json, true);

// Load and decode the secondary JSON file (episodes_data3.json)
$json_file_3 = 'episodes_data3.json';
if (!file_exists($json_file_3)) {
    die("Secondary data file not found");
}
$json3 = file_get_contents($json_file_3);
$data3 = json_decode($json3, true);

// Check if the main JSON is valid
if (json_last_error() !== JSON_ERROR_NONE) {
    die("Error decoding JSON: " . json_last_error_msg());
}

// Check if the series and season exist in the main or secondary JSON data
if (isset($data[$series_name]['seasons'][$season_name])) {
    $episodes = $data[$series_name]['seasons'][$season_name]['episodes'];
    $source = 'movie';  // Use movie.php
} elseif (isset($data3[$series_name]['seasons'][$season_name])) {
    $episodes = $data3[$series_name]['seasons'][$season_name]['episodes'];
    $source = 'movie2';  // Use movie2.php
} 
?>
